function filteredResults(searchResults) {
        return searchResults.map((result) => {
          let title = result.snippet.title
          for (let i = 0; i < symbols.length; i++) {
            if (title.includes(symbols[i])) {
              title = title.replace(new RegExp(symbols[i], 'g'), '')
            }
          }
          return { ...result, title }
        });
}
